import React from 'react';

function StockList({stocks}){
  console.log(stocks);
	return (
   <ol className="stock-list"> 
    {
    stocks.forEach((stockMap,index)=>{
      console.log(stockMap["stockName"]);
      return  <li key={index}>
            <div className="stock-item">
                <span>{stockMap["stockName"]}</span>
                <span>{stockMap["price"]}</span>
            </div> 
      </li>
    })
    }
    </ol>
	);
};

export default StockList;
